import { useParams } from "react-router";

function AnnonceDetail(props) {

    let { annonceId } = useParams();
    var annonces = props.annonces;

    var wantedData = annonces.filter(function(i) {
        console.log("i: " + i.annonceId)
        console.log("annonceId: " + annonceId)
        return i.annonceId - annonceId === 0;
      });

    console.log("wanted: " + wantedData[0].title)

    return(
        <div>

            {annonces.map(annonce => (
                <li>
                    <li>{annonce.annonceId}</li>
                    <li>{annonce.title}</li>
                </li>
            ))}
        </div>
    )
}

export default AnnonceDetail;
